import { connect } from "react-redux";
import { changeCountDownState } from "../actions/action";
import Page from "../components/page";

const mapDispatchToProps = { changeCountDownState };

const mapStateToProps = (state) => ({ isCountDown: state.isCountDown });

export default connect(mapStateToProps, mapDispatchToProps)(Page);
